import React from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer } from 'recharts';
import './AnalysisViewer.css';

function AnalysisViewer({ data }) {
    if (!data) return null;

    const { platform, datalog_summary, issues, safety_results } = data;

    const renderIssues = () => {
        if (!issues || issues.length === 0) {
            return (
                <div className="no-issues">
                    <h4>‚úÖ No Critical Issues Found</h4>
                    <p>Your datalog looks clean! No major issues detected.</p>
                </div>
            );
        }

        return (
            <div className="issues-list">
                <h4>‚ö†Ô∏è Issues Detected</h4>
                {issues.map((issue, index) => (
                    <div key={index} className={`issue-item ${issue.severity}`}>
                        <div className="issue-header">
                            <span className="issue-type">{issue.type}</span>
                            <span className={`severity-badge ${issue.severity}`}>
                                {issue.severity.toUpperCase()}
                            </span>
                        </div>
                        <p className="issue-message">{issue.message}</p>
                        <p className="issue-recommendation">
                            <strong>Recommendation:</strong> {issue.recommendation}
                        </p>
                    </div>
                ))}
            </div>
        );
    };

    const renderSafetyStatus = () => {
        if (!safety_results) return null;

        const statusColor = safety_results.overall_status === 'safe' ? 'success' : 'danger';

        return (
            <div className={`safety-status ${statusColor}`}>
                <h4>
                    {safety_results.overall_status === 'safe' ? 'üõ°Ô∏è' : '‚ö†Ô∏è'} 
                    Safety Status: {safety_results.overall_status.toUpperCase()}
                </h4>

                {safety_results.critical_issues && safety_results.critical_issues.length > 0 && (
                    <div className="critical-issues">
                        <h5>Critical Safety Issues:</h5>
                        {safety_results.critical_issues.map((issue, index) => (
                            <div key={index} className="critical-issue">
                                {issue.message}
                            </div>
                        ))}
                    </div>
                )}

                {safety_results.warnings && safety_results.warnings.length > 0 && (
                    <div className="safety-warnings">
                        <h5>Safety Warnings:</h5>
                        {safety_results.warnings.map((warning, index) => (
                            <div key={index} className="safety-warning">
                                {warning.message}
                            </div>
                        ))}
                    </div>
                )}
            </div>
        );
    };

    return (
        <div className="analysis-viewer">
            <div className="analysis-header">
                <h2>üìä Datalog Analysis Results</h2>
                <div className="platform-info">
                    <span className="platform-badge">{platform}</span>
                    <span className="data-info">
                        {datalog_summary?.rows || 0} data points ‚Ä¢ {datalog_summary?.columns || 0} parameters
                    </span>
                </div>
            </div>

            <div className="analysis-grid">
                <div className="analysis-section">
                    <h3>üîç Issue Detection</h3>
                    {renderIssues()}
                </div>

                <div className="analysis-section">
                    <h3>üõ°Ô∏è Safety Analysis</h3>
                    {renderSafetyStatus()}
                </div>

                <div className="analysis-section full-width">
                    <h3>üìà Data Summary</h3>
                    <div className="summary-stats">
                        <div className="stat-item">
                            <span className="stat-label">Duration</span>
                            <span className="stat-value">
                                {datalog_summary?.duration ? 
                                    `${datalog_summary.duration.toFixed(1)}s` : 
                                    'Unknown'
                                }
                            </span>
                        </div>
                        <div className="stat-item">
                            <span className="stat-label">Data Points</span>
                            <span className="stat-value">{datalog_summary?.rows || 0}</span>
                        </div>
                        <div className="stat-item">
                            <span className="stat-label">Parameters</span>
                            <span className="stat-value">{datalog_summary?.columns || 0}</span>
                        </div>
                        <div className="stat-item">
                            <span className="stat-label">Platform</span>
                            <span className="stat-value">{platform}</span>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default AnalysisViewer;
